    return (
      <Html lang="ru">
        <Head>
          <meta charSet="utf-8" />
          
          {/* <meta name="viewport" content="width=device-width, initial-scale=1.0" /> */}
        </Head>
        <body>
          <Main />
          <NextScript />
        </body>
      </Html>
    )
  }
}
